import React from 'react'

const AddPaciente = () => {
  return (
    <div className='flex flex-col bg-white w-auto p-4 justify-between'>
        <label className='my-4' htmlFor="Cedula">Cedula</label>
        <input className='w-96' type="text" name="Cedudla" id="Cedula" minLength={10} maxLength={10}/>
        <label className='my-4' htmlFor="Nombre">Nombre</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Nombre" id="Nombre" minLength={1} maxLength={200}/>
        <input className='m-auto w-2/3 my-4' type="submit" value="Agregar" />
    </div>
  )
}

export default AddPaciente
